import React, { Component } from 'react';
import axios from 'axios';

class CargarPedido extends Component {

    constructor(props) {
        super(props);
        this.state = {
            satellite: props.location.state,
            resp: {}
        }
    }

    render() {
        return (
            <>
                <div class="firstContainer" ng-controller="BuscarImagenesController">
                    <form action="" id="formulario" ng-submit="setBusqueda()">
                        <div class="input">
                            <input type="text" id="busqueda" placeholder="buscar"/>
                        </div>
                        <div class="buscar">
                            <button type="submit" value="Buscar"> Buscar</button>
                        </div>
                    </form>

                    <div class="container">
                        <div ng-repeat="imagen in imagesList" class="imgContainer" ng-show="$index < loadIndex">

                            <span ng-if="!imagen.liked_by_user" class="material-icons saved" ng-click="guardar(imagen)">save</span>
                            <span ng-if="imagen.liked_by_user || window.localStorage.getItem(imagen.id) != null" class="material-icons" ng-click="guardar(imagen)" >check_box</span>
                            <img src="{{imagen.urls.thumb}}" alt="{{imagen.alt_description}}" />
                        </div>
                    </div>
                    <div ng-if="loadIndex < imagesList.length">
                        <button id="loadMore" ng-click="cargarMas()">Cargar Mas</button>
                    </div>
                </div>
            </>
        )
    }

}

export default SatelliteData;
